import React from "react";
import { MDBBtn, MDBContainer,MDBRow,MDBCol,MDBInput } from "mdbreact";

import './../css/design.css';
import offers_jpg2 from './../images/offers_jpg2.jpg';
import heartrate from './../images/heartrate.png';
class ChatComp extends React.Component{

    state = {
        radio: 2
      }

      onClick = (nr) => () => {
        this.setState({
          radio: nr
        });
      }
    render() {
      return (

            <MDBContainer  className="mt-5 mt-5">
              <MDBRow className="pl-3 pr-3">
                <MDBCol lg="6" md="6" sm="12" xs="12">

               <h5><b>Hey Welcome User, chat with our doctors for free</b></h5>
               <p style={{letterSpacing:0,fontSize:12}}>Why wasting time on booking appoints. Consult any doctor when you want.</p>
             <p className="my-4" style={{letterSpacing:0,fontSize:12}}><b>Feel free to tell</b></p>
             <MDBInput gap onClick={this.onClick(2)} checked={this.state.radio===2 ? true : false} label="I have fever" type="radio"
      id="radio2" />
      <MDBInput gap onClick={this.onClick(2)} checked={this.state.radio===2 ? true : false} label="I have hair related problems" type="radio"
      id="radio2" />
      <MDBInput gap onClick={this.onClick(2)} checked={this.state.radio===2 ? true : false} label="I have stomach related problems" type="radio"
      id="radio2" />
      <MDBInput gap onClick={this.onClick(2)} checked={this.state.radio===2 ? true : false} label="I have other health problem" type="radio"
      id="radio2" />

      <div className="active-pink-3 active-pink-4 mt-4 mb-4">
        <input className="form-control-sm-6" type="text" placeholder="Search" aria-label="Search" />
      </div>

                </MDBCol>
            <MDBCol  lg="6" md="6" sm="12" xs="12">
            <h5><b>Are you a Doctor?</b></h5>
            <p style={{letterSpacing:0,fontSize:12}}>You can join us help people to improve their health with your help. Are you willing to serve people?</p>
            <MDBBtn color="primary" rounded>Join Now</MDBBtn>

            </MDBCol>
              </MDBRow>
              </MDBContainer>


        );
    }




}


export default ChatComp;
